import org.junit.Assert;

/**
 * Created by hulei on 2018/8/7.
 */
public class ShortestPalindrome {
    public static void main(String[] args) {
        Assert.assertEquals(shortestPalindrome("aba"), "aba");
        Assert.assertEquals(shortestPalindrome(""), "");
        Assert.assertEquals(shortestPalindrome("aacecaaa"), "aaacecaaa");
        Assert.assertEquals(shortestPalindrome("abcd"), "dcbabcd");
        Assert.assertEquals(shortestPalindrome
                        (""),
                "");
    }

    public static String shortestPalindrome(String s) {
        if (s.length() == 0) { return ""; }

        boolean[][] matrix = new boolean[s.length()][s.length()];
        int maxEnd=0;
        for (int len = 1; len <= s.length(); len++) {
            for (int begin = 0; begin <= s.length() - len; begin++) {
                int end = begin + len - 1;
                if (s.charAt(begin) == s.charAt(end)) {
                    if (end - begin <= 1 || matrix[begin + 1][end - 1]) {
                        matrix[begin][end]=true;
                        if (begin==0){
                            maxEnd = end;
                        }
                    }
                }
            }
        }
        StringBuilder sb= new StringBuilder(s);
        String compensate = s.substring(maxEnd + 1, s.length());
        for (char c : compensate.toCharArray()) {
            sb.insert(0, c);
        }

        return sb.toString();
    }
}
